import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <form>
              <label>
                Nom:
                <input type="text" name="name" />
              </label>
              <label>
                Prénom:
                <input type="text" name="name" />
              </label>
              <input type="submit" value="Ajouter" />
            </form>

            <table border="1" cellpadding="10">
                <tr>
                    <td >id</td> <td>Nom</td><td>Prénom</td><td>Action</td>
                </tr>
                <tr>
                    <td>0</td><td>nanta</td><td>14</td><td></td>

                </tr>
                <tr>
                        <td>1</td><td>herinantenaina</td><td>85</td><td></td>
                </tr>

            </table>


      </div>
    );
  }
}

export default App;
